<span class="line"><span style="color:#E1E4E8;">    </span><span style="color:#79B8FF;">&quot;document_type&quot;</span><span style="color:#E1E4E8;">: </span><span style="color:#9ECBFF;">&quot;panel_mob2&quot;</span><span style="color:#E1E4E8;">,</span></span>
